import React from "react";
import CardList from "./CardList";
import SearchBox from './SearchBox';
import { robots }  from './robots';



const App = () => {
    constructor(); {
        this.state = {
            robots: robots,
            searchfield: ''
        }
    }
    return (
        <div className="tc">
            <h1>RobotFriends</h1>
            <SearchBox />
            <CardList robots={robots}/>
        </div>
    )
}

export default App;
